Rubber Klinik

Starring: Jewell Marceau, Anna Mills and Mistress Jean
An unsuspecting Lab assistant is caught off gaurd as two cunning, yet playful beauties, break into the Klinik and render her completely helpless. The more dominant of the two, Mistress Jean, puts the helpless captive and her own sidekick through various torments in some of the most intriguing equipment ever filmed. Vacuum Bed, Hoods, Suspension and plenty of Latex!

